import './App.css';
import React from 'react';

class Professores extends React.Component
{
  render()
  {
    const profs = ['Arliones', 'Odilson'];
    console.log(profs.length);
    return (<h1>Professores</h1> + profs.map((prof) => <li>{prof}</li>));
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
